      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq1_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 건강 상태가 좋을 때 코로나19 백신을 접종받아야 하며, 접종 시 희사 예진을 통해 금기/제외 사항등을 확인하여 예방접종\r\n");
      out.write("    	가능여부를 판단해야 합니다. <br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 다음과 같은 경우는 코로나19 예방접종을 받아서는 안됩니다.<br>\r\n");
      out.write("    	&nbsp; - 코로나 19 백신 구성 성분에 대한 아나필락시스 같은 심각한 알레르기 반응이 나타난 경우<br> \r\n");
      out.write("    	&nbsp; - 1차 코로나19 예방접종 후 아나필락시스와 같은 심각한 알레르기 반응이 나타난 경우, 첫번째 백신과 동일 백신으로 \r\n");
      out.write("    	접종 금지<br>\r\n");
      out.write("    	&nbsp; - 1차 바이러스 벡터 코로나19 백신(아스트라제네카, 얀센) 접종 후 혈소판감소성, 혈전증이 발생한 경우, 바이러스 벡터\r\n");
      out.write("    	코로나 19 백신 접종 금지<br>\r\n");
      out.write("    	&nbsp; - 모세혈관 누출 증후군의 병력이 있는 경우, 아스트라제네카 코로나19 백신 접종 금지<br><br>\r\n");
      out.write("    	◎ 다음과 같은 경우는 코로나19 예방접종을 연기합니다.<br>\r\n");
      out.write("    	&nbsp; - 코로나19 감염이 의심되는 경우 선별진료소 등을 통해 신속히 진단검사를 받아야 하며, 결과가 나올때까지\r\n");
      out.write("    	예방접종을 연기합니다.<br> \r\n");
      out.write("    	&nbsp; - 격리중인 코로나19 환자 및 접촉자는 격리해제 될 때까지 예방접종을 연기합니다.<br> \r\n");
      out.write("    	&nbsp; - 발열(37.5℃ 이상) 등 급성병증이 있는 경우 증상이 없어질때까지 예방접종을 연기합니다. \r\n");
