      out.write("    	&nbsp; - 특별한 알레르기가 없었던 경우는 접종 후 15분간 관찰합니다.<br>\r\n");
      out.write("    	&nbsp; - 과거에 음식, 약물 등의 알레르기 경험이 있었던 경우에는 30분간 관찰합니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 귀가 후 최소 3시간 이상 안정을 취하며 이상반응이 나타나는지 주의 깊게 관찰하며, 접종 후 최소 4주간은 특별한 관심을 \r\n");
      out.write("    	가지고 관찰하며, 평소와 다른 신체 증상이 나타나면 바로 의사의 진료를 받도록 합니다. <br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 접종당일과 다음날은 과격한 운동 및 음주를 삼가고, 접종당일은 간단한 샤워는 가능하지만 반식욕, 사우나, 찜질방, 수영 등은 피하고, 접종부위는 청결히 유지합니다. <br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 만약 예방접종 후 고열, 두드러기, 호흡곤란, 입술 또는 입안의 부종 등 심한 알레르기 반응 등 평소와 다른 증상이\r\n");
